import axios from 'axios'
import React, { useEffect, useState } from 'react'
import placeholderImg from '../Static/Images/placeholder-img.png'






export default function WhoToFollow() {
    const [users, setUsers] = useState([]);

    function getAllUsers(){
        axios.get("http://localhost:8080/api/users/")
            .then(response => {
                console.log(response.data)
            })
            .catch(err => console.log(err))
    }

    useEffect(()=> {
        getAllUsers();
    },[])


    return (
        <div style={{backgroundColor: "rgba(60, 64, 67, 0.01)"}} className="rounded mt-5 p-1" id="who-to-follow-container">
            <button onClick={getAllUsers}>Get All</button>
            <h3 className="bg-transparent">Who to follow</h3>
            <ul className="bg-transparent px-1">
                <li className="d-flex justify-content-between align-items-center bg-transparent my-3 ">
                    <img src={placeholderImg} alt="" className="rounded-circle bg-transparent" id="tweet-form-profile-img"/>
                    <span className="bg-transparent">ExampleName1</span>
                    <button className="btn rounded-pill bg-light p-2">Follow</button>
                </li>
                <li className="d-flex justify-content-between align-items-center bg-transparent my-3">
                    <img src={placeholderImg} alt="" className="rounded-circle bg-transparent" id="tweet-form-profile-img"/>
                    <span className="bg-transparent">ExampleName2</span>
                    <button className="btn rounded-pill bg-light p-2">Follow</button>
                </li>
                <li className="d-flex justify-content-between align-items-center bg-transparent my-3">
                    <img src={placeholderImg} alt="" className="rounded-circle bg-transparent" id="tweet-form-profile-img"/>
                    <span className="bg-transparent">ExampleName2</span>
                    <button className="btn rounded-pill bg-light p-2">Follow</button>
                </li>
            </ul>
        </div>
    )
}
